package com.muebles.persistencia;

public class Usuario {
	private int id;
	private String USNOM;
	private String USAPE;
	private int USCED;
	private String USEMA;
	private String USCIU;
	private String USTEL;
	private String USPAS;

	public Usuario() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the id
	 */
	public int getId() {
		return id;
	}

	/**
	 * @param id
	 *            the id to set
	 */
	public void setId(int id) {
		this.id = id;
	}

	/**
	 * @return the uSNOM
	 */
	public String getUSNOM() {
		return USNOM;
	}

	/**
	 * @param uSNOM
	 *            the uSNOM to set
	 */
	public void setUSNOM(String uSNOM) {
		USNOM = uSNOM;
	}

	/**
	 * @return the uSAPE
	 */
	public String getUSAPE() {
		return USAPE;
	}

	/**
	 * @param uSAPE
	 *            the uSAPE to set
	 */
	public void setUSAPE(String uSAPE) {
		USAPE = uSAPE;
	}

	/**
	 * @return the uSCED
	 */
	public int getUSCED() {
		return USCED;
	}

	/**
	 * @param uSCED
	 *            the uSCED to set
	 */
	public void setUSCED(int uSCED) {
		USCED = uSCED;
	}

	/**
	 * @return the uSEMA
	 */
	public String getUSEMA() {
		return USEMA;
	}

	/**
	 * @param uSEMA
	 *            the uSEMA to set
	 */
	public void setUSEMA(String uSEMA) {
		USEMA = uSEMA;
	}

	/**
	 * @return the uSCIU
	 */
	public String getUSCIU() {
		return USCIU;
	}

	/**
	 * @param uSCIU
	 *            the uSCIU to set
	 */
	public void setUSCIU(String uSCIU) {
		USCIU = uSCIU;
	}

	/**
	 * @return the uSTEL
	 */
	public String getUSTEL() {
		return USTEL;
	}

	/**
	 * @param uSTEL
	 *            the uSTEL to set
	 */
	public void setUSTEL(String uSTEL) {
		USTEL = uSTEL;
	}

	/**
	 * @return the uSPAS
	 */
	public String getUSPAS() {
		return USPAS;
	}

	/**
	 * @param uSPAS
	 *            the uSPAS to set
	 */
	public void setUSPAS(String uSPAS) {
		USPAS = uSPAS;
	}

}
